"use strict";function clippy(s){let t;let e=document.querySelector(s);if(e.hasAttribute("data-clippy")){t=e.getAttribute("data-clippy")}else{t=e.innerText};document.body.innerHTML+=`<input type="text" id="clippy-temp" value="${t}" style="width: 0px; height: 0px;">`;let h=document.querySelector("#clippy-temp");h.select();h.setSelectionRange(0,t.lenght+9);document.execCommand("copy");h.remove()};
